PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "mainPage_fundacion" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(30) NOT NULL, "tipo" varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS "Facultad" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(30) NOT NULL, "descripcion" varchar(30) NOT NULL, CONSTRAINT "unique_foraneas_Facultad" UNIQUE ("nombre"));
CREATE TABLE IF NOT EXISTS "Beca_Documentos" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "beca_id" integer NOT NULL REFERENCES "Beca" ("id") DEFERRABLE INITIALLY DEFERRED, "documentos_id" integer NOT NULL REFERENCES "mainPage_documentos" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Beca_Requisitos" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "beca_id" integer NOT NULL REFERENCES "Beca" ("id") DEFERRABLE INITIALLY DEFERRED, "requisitos_id" integer NOT NULL REFERENCES "mainPage_requisitos" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "mainPage_union_u_f" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "facultad_id" integer NOT NULL REFERENCES "Facultad" ("id") DEFERRABLE INITIALLY DEFERRED, "univeridad_id" integer NOT NULL REFERENCES "Universidad" ("id") DEFERRABLE INITIALLY DEFERRED, CONSTRAINT "unique_foraneas_union" UNIQUE ("univeridad_id", "facultad_id"));
CREATE TABLE IF NOT EXISTS "mainPage_configuracion_becas" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Beca_id" integer NOT NULL REFERENCES "Beca" ("id") DEFERRABLE INITIALLY DEFERRED, "Fundacion_id" integer NOT NULL REFERENCES "mainPage_fundacion" ("id") DEFERRABLE INITIALLY DEFERRED, "Union_U_F_id" integer NOT NULL REFERENCES "mainPage_union_u_f" ("id") DEFERRABLE INITIALLY DEFERRED, CONSTRAINT "unique_foraneas_configuracion" UNIQUE ("Union_U_F_id", "Beca_id", "Fundacion_id"));
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "cal_event" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(200) NOT NULL, "description" text NOT NULL, "start_time" datetime NOT NULL, "end_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "mainPage_documentos" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Descripcion" varchar(200) NOT NULL);
CREATE TABLE IF NOT EXISTS "mainPage_requisitos" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Descripcion" varchar(200) NOT NULL);
CREATE TABLE IF NOT EXISTS "Universidad" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nit" integer NOT NULL, "ciudad" varchar(50) NOT NULL, "pais" varchar(50) NOT NULL, "nombre" varchar(50) NOT NULL);
CREATE TABLE IF NOT EXISTS "Beca" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(50) NOT NULL, "tipo" varchar(10) NOT NULL, "Descripcion" varchar(1000) NOT NULL, "valor" varchar(100) NOT NULL, CONSTRAINT "unique_foraneas_Beca" UNIQUE ("nombre"));
CREATE TABLE IF NOT EXISTS "mainPage_becas_fav" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "tipo" varchar(10) NOT NULL, "Configuracion_Becas_id" integer NOT NULL REFERENCES "mainPage_configuracion_becas" ("id") DEFERRABLE INITIALLY DEFERRED, "usuario_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, CONSTRAINT "unique_foraneas_favoritos_Beca" UNIQUE ("usuario_id", "Configuracion_Becas_id", "tipo"));
CREATE TABLE IF NOT EXISTS "mainPage_facultad_fav" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Estudiante_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "Facultad_id" integer NOT NULL REFERENCES "Facultad" ("id") DEFERRABLE INITIALLY DEFERRED, CONSTRAINT "unique_foraneas_favoritos_Facultad" UNIQUE ("Facultad_id", "Estudiante_id"));
CREATE TABLE IF NOT EXISTS "mainPage_universidad_fav" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Estudiante_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "Universidad_id" integer NOT NULL REFERENCES "Universidad" ("id") DEFERRABLE INITIALLY DEFERRED, CONSTRAINT "unique_foraneas_favoritos_Universidad" UNIQUE ("Universidad_id", "Estudiante_id"));
